    constructor(props) {
        super(props);

        this.state = {
            categoryList : []
        }
    }


    componentDidMount(){

    var data = { allPacks:true, portal: true};
        UserService.getCategory(data)
        .then((res) => {
            let data = resolveResponse(res);
            console.log(data);
            if(data && data.result){
                this.setState({products: data.result.data})
            }
        });

    }
    render() {
        return (
           <React.Fragment> 
               <HeaderNavbar />


           </React.Fragment>
        );
    }
}

